(4895, 'com', 'reminders3', '80_body', 'MultiCell', 'Contenido carta', '{\"SetFont\":{\"font\":\"Arial\",\"format\":{\"R\":\"R\"},\"fontsize\":\"10\"},\"MultiCell\":{\"label\":\"Ch\\u00e8re Madame, Cher Monsieur,\\r\\n\\r\\nEn d\\u00e9pit de plusieurs relances rest\\u00e9es jusqu\\u2019\\u00e0 ce jour infructueuses, je constate qu\\u2019\\u00e0 la date de la pr\\u00e9sente, \\u00e0 savoir le (date), vous me devez toujours la somme de (montant) au motif de factures impay\\u00e9es.\\r\\n\\r\\nCette situation peu confortable m\\u2019impose la r\\u00e9daction de la pr\\u00e9sente afin de vous signifier votre mise en demeure de me r\\u00e9gler ladite somme. Vous disposez pour cela d\\u2019un d\\u00e9lai de dix jours \\u00e0 compter de la date de ce courrier, pour proc\\u00e9der au paiement des sommes qui me sont dues. Dans le cas contraire, je m\\u2019autorise une action en justice afin de faire valoir mes droits.\\r\\n\\r\\nDans le but de vous \\u00e9viter des poursuites judiciaires, je vous informe de mon consentement \\u00e0 bien vouloir \\u00e9tudier toute r\\u00e9solution de cette mise en demeure par un accord \\u00e0 l\\u2019amiable ou une n\\u00e9gociation qui inclurait un d\\u00e9dommagement et des int\\u00e9r\\u00eats cons\\u00e9quents aux pr\\u00e9judices subis par cette situation. Cet effort de ma part constitue ma derni\\u00e8re proposition avant le recours aux tribunaux comp\\u00e9tents. Je vous incite donc \\u00e0 agir en cons\\u00e9quence.\\r\\n\\r\\nDans l\\u2019attente de votre retour, je vous prie d\\u2019agr\\u00e9er, l\\u2019expression de mes sentiments les meilleurs.\",\"w\":\"\",\"h\":\"5\",\"align\":\"L\"},\"SetTextColor\":{\"r\":\"0\",\"g\":\"0\",\"b\":\"0\"},\"SetDrawColor\":{\"r\":\"\",\"g\":\"\",\"b\":\"\"},\"SetFillColor\":{\"r\":\"250\",\"g\":\"250\",\"b\":\"200\"},\"hidden\":false}', 420, 1),
